INSERT INTO `news` (`id`, `title`, `menu_id`, `submenu_id`, `tags`, `description`, `is_latest`, `is_feature`, `is_publish`, `img`, `date`, `created_at`, `trash`) VALUES
(2, 'শিক্ষার্থীদের স্বপ্ন সরকারের সহায়তা', 3, 3, 'lksdfsd, sdflsdf,sdfsdf, sdf,sdfs,dfsd, ', 'ডিজিটাল নিরাপত্তা আইন বাতিলসহ তিন দফা দাবিতে প্রগতিশীল ছাত্রজোটের ডাকা স্বরাষ্ট্র মন্ত্রণালয় ঘেরাও কর্মসূচি শেষ হয়েছে৷ ‘পুলিশের অনুরোধে শান্তিপূর্ণভাবে সমাবেশ শেষ করায়’ পুলিশ তাঁদের ধন্যবাদ জানিয়েছে। লেখক মুশতাক আহমেদের কারাগারে মৃত্যুর তদন্ত ও বিচার, মৃত্যুর ঘটনার প্রতিবাদ করতে গিয়ে গ্রেপ্তার ৮ জনের মুক্তি এবং ডিজিটাল নিরাপত্তা আইন বাতিলের দাবিতে এই কর্মসূচি দেওয়া হয়েছিল।\r\n\r\nডিজিটাল নিরাপত্তা আইন বাতিলসহ তিন দফা দাবিতে প্রগতিশীল ছাত্রজোটের ডাকা স্বরাষ্ট্র মন্ত্রণালয় ঘেরাও কর্মসূচি শেষ হয়েছে৷ ‘পুলিশের অনুরোধে শান্তিপূর্ণভাবে সমাবেশ শেষ করায়’ পুলিশ তাঁদের ধন্যবাদ জানিয়েছে। লেখক মুশতাক আহমেদের কারাগারে মৃত্যুর তদন্ত ও বিচার, মৃত্যুর ঘটনার প্রতিবাদ করতে গিয়ে গ্রেপ্তার ৮ জনের মুক্তি এবং ডিজিটাল নিরাপত্তা আইন বাতিলের দাবিতে এই কর্মসূচি দেওয়া হয়েছিল।', 1, 1, 1, 'public/images/post/1615608265.jpg', '2021-03-13', '2021-03-12 16:11:03', 0),
